import React from "react";
import { ListGroup } from "react-bootstrap";

const ArtistList = (props) => {
  // const { id, name } = artists;

  const renderArtistList = () => {
    {
      props.artists.map((a) => (
        <ListGroup.Item key={a.id}>{a.name}</ListGroup.Item>
      ));
    }
  };

  return (
    <div className="main">
      <h2>Artists list</h2>
    </div>
  );
};

export default ArtistList;
